description:
Кольцо из желтого  золота 585 пробы с натуральными природными бриллиантами.
Красивое кольцо бесконечность поможет Вам выразить Ваши чувства и символично подчеркнёт вашу любовь. Ширина шинки 7 мм, толщина шинки 1 мм.
Вставка из натуральных природных драгоценных камней бриллиантов (Бриллианты АЛРОСА, Якутия): р. 17.0 - 84 брл Кр-17 0,270Ct 2/2, вес: 3,14;
